import { applicationConfig, type Preview } from '@storybook/angular';
import { setCompodocJson } from '@storybook/addon-docs/angular';
import docJson from '../documentation.json';
import { ISOALTE_TRANSLATE_SERVICE, MissingTranslationHandler, TranslateCompiler, TranslateDefaultParser, TranslateFakeCompiler, TranslateLoader, TranslateModule, TranslateParser, TranslateService, TranslateStore, USE_DEFAULT_LANG, USE_EXTEND } from '@ngx-translate/core';
import { Observable, of } from 'rxjs';
import { APP_INITIALIZER, importProvidersFrom } from '@angular/core';
setCompodocJson(docJson);



export class FakeLoader implements TranslateLoader {
    getTranslation(lang: string): Observable<any> {
      const translations: { [key: string]: any } = {
        en: {
            upload: {
                dropElement: {
                    chooseFile: "Datei wählen",
                    dropIt: "Los lassen"
                }
            },
        },
        de: {
            upload: {
                dropElement: {
                    chooseFile: "Datei wählen",
                    dropIt: "Los lassen"
                }
            },
        }
      };
      return of(translations[lang] || {});
    }
  }
  

const preview: Preview = {
    parameters: {
        controls: {
            matchers: {
                color: /(background|color)$/i,
                date: /Date$/i
            }
        },
        designToken: {
            defaultTab: 'Colors',
            tokens: {
              color: ['../assets/styles.scss'],
            },
          },
    },
    decorators: [
        applicationConfig({
          providers: [
            {
                provide: TranslateLoader,
                useClass: FakeLoader,
              },
              {
                provide: TranslateCompiler,
                useClass: TranslateFakeCompiler,
              },
              {
                provide: TranslateParser,
                useClass: TranslateDefaultParser,
              },
              {
                provide: MissingTranslationHandler,
                useValue: null,
              },
              {
                provide: USE_DEFAULT_LANG,
                useValue: true,
              },
              {
                provide: USE_EXTEND,
                useValue: false,
              },
              { provide: ISOALTE_TRANSLATE_SERVICE, 
                useValue: false 
            },
              TranslateStore,
            {
              provide: APP_INITIALIZER,
              useFactory: (translate: TranslateService) => () => {
                translate.setDefaultLang('de');
                translate.use('de');
                return Promise.resolve();
              },
              deps: [TranslateService],
              multi: true
            },
          ]
        })
      ]
};

export default preview;

